PREFIX terms: <http://rdf.ebi.ac.uk/terms/ensembl/>

SELECT (COUNT(DISTINCT ?species) AS ?species_count)
FROM <http://rdfportal.org/dataset/ensembl>
WHERE {
    ?gene a terms:EnsemblGene ;
          obo:RO_0002162 ?species .
}"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "ensembl", "sparql_query": "PREFIX obo: <http://purl.obolibrary.org/obo/>
PREFIX terms: <http://rdf.ebi.ac.uk/terms/ensembl/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?species (COUNT(?gene) AS ?gene_count)
FROM <http://rdfportal.org/dataset/ensembl>
WHERE {
    ?gene a terms:EnsemblGene ;
          obo:RO_0002162 ?species .
}
GROUP BY ?species
ORDER BY DESC(?gene_count)
LIMIT 20"}}]
